        "description": "Kvinna utsatt för försök till bedrägeri via telefon.",
        "content": "<p>Polisen får under onsdagen in en anmälan från en kvinna som blivit uppringd från dolt nummer. En man säger sig arbeta med säkerhetstjänst på ett försäkringsbolag och säger att någon ska ha kommit åt att swisha runt 10 000 kronor från kvinnans konto. Han ber henne logga in på Swish och efterfrågar även hennes bankkortsnummer och säger att han ska hjälpa henne att få tillbaka pengarna. Kvinnan avbryter samtalet.</p>\n<p>Det hela rubriceras som försök till bedrägeri.</p>\n<p>Det finns saker du kan göra för att minska risken att bli utsatt för bedrägeri. En är att aldrig lämna ut känsliga uppgifter eller koder.</p>",
