        "description": "Polisens fjällräddning i Norrbotten kommer att ha sin årliga vinterövning 14-16 februari i Gällivare.",
        "content": "<p>Övningen utgår från Hellnerstadion och kommer att hållas omkring Dundret.</p>\n<p>– Under övningen deltar ett 30-tal fjällräddare per dag. Övningen går bland annat ut på att fjällräddarna ska träna på sina färdigheter i första hjälpen och omhändertagande av olika typer av skador, lavinräddning och navigation, säger Fredrik Groth, polisinspektör och samordnare för fjällräddarna vid polisen i Norrbotten.</p>\n<p>Övningen består av teori samt fyra olika stationer där vissa har figuranter som spelar skadade. Fjällräddarna kommer att larmas om händelser, allt från lavinlarm med försvunna personer till skoterolycka, och de förflyttar sig mellan platserna med snöskoter. Tillsammans med instruktörer ska de sedan öva på att lösa händelserna på bästa sätt. En del i övningen är samverkan med andra aktörer och i denna övning deltar regionens ambulanshelikopter.</p>\n<p>– Att vi får chans att öva betyder att vi kan upprätthålla en hög nivå vid våra insatser, att vi får samträna grupperna tillsammans med andra aktörer som vi samverkar med i fjällräddningsinsatser. Polisen är huvudman för fjällräddning men många av insatserna görs både med eller självständigt av andra, som kommunal räddningstjänst eller regionens ambulansverksamhet, säger Fredrik Groth.</p>\n<p><strong>Mediakontakter:</strong></p>\n<p>Har du frågor om övningen kontakta: Fredrik Groth, 114 14</p>\n<p>Tyvärr kommer de medverkande inte att ha möjlighet att ställa upp på intervjuer under övningsdagarna då de medverkar i övningen, men NN och NN finns tillgängliga under torsdagen.</p>\n<p>Media är välkomna att fotografera och filma på plats i samband med övningen.</p>\n",
