        "description": "Dieselstöld, Hovshaga.",
        "content": "<p>Polis skickades till Hovshaga efter ett larm om en pågående dieselstöld där personer setts slanga diesel från en grävmaskin vid en byggarbetsplats. När den första patrullen kom fram till platsen såg de en bil som stod parkerad vid ett bostadsområde i närheten av brottsplatsen. Bilen stämde överens med beskrivningen av dieseltjuvarnas bil och när patrullen skulle kontrollera personerna i bilen så valde föraren att köra därifrån.</p>\n<p>Den flyende bilen stoppades av en annan patrull en kort bit från där den först anträffades och de två personerna i bilen lämnade då platsen springandes in i bostadsområdet. De båda patrullerna spanade efter de misstänkta tjuvarna i området men tyvärr utan resultat.</p>\n<p>I samband med att föraren körde ifrån den första patrullen så körde man in i en parkerad bil varpå en anmälan om stöld samt smitning från trafikolycksplats är upprättad.</p>\n",
