        "content": "<p>06.39 Larm om en singelolycka på länsväg 129 vid en järnvägsövergång i höjd med Kungshöga, öster om Mariannelund. En personbil ska ha kört in i ett träd och blivit ståendes innanför järnvägsbommarna, dock ej på spåret. En person ska ha suttit i bilen, men tagit sig ur fordonet själv.</p>\n<p>07.31 Polis på plats. Föraren av personbilen har inga skador. Bärgare beställd till bilen, som står cirka fem meter från järnvägsspåret.</p>\n<p>08.30 Bilen är nu bärgad. Det finns ingen misstanke om brott, bilisten hade väjt för vildsvin.</p>",
