        "description": "Ett urval av händelser i länet sedan klockan 22 i går kväll.",
        "content": "<p>Polisen i Jönköpings län har hanterat ett 50-tal händelser sedan klockan 22 i går kväll. Ingen person har gripits.</p>\n<p><strong>22.10 Misshandel, Nässjö</strong><br /> Polis beordrades till Nässjö sporthall där det uppstått bråk mellan två personer i samband med en sportlovsaktivitet. De två inblandade var kvar på platsen när polis kom dit, båda hade skador efter bråket och båda fick åka till sjukhus för kontroll. Två anmälningar om misshandel av normalgraden har upprättats, där de två inblandade är både målsägande och misstänkta. De är båda pojkar i 15-årsåldern.</p>\n<p><strong>01.13 Brand, Jönköping</strong><br /> En lastbil började brinna under färd på riksväg 40 i höjd med Bottnaryd. Stora trafikstörningar, men inga personskador då föraren tog sig ut själv. Branden hade börjat med en punktering som lett vidare till att det börjat brinna i ekipaget. Bärgare var på plats först vid 5-tiden och påbörjade bärgning.</p>\n<p><strong>04.14 Stöld/inbrott, Jönköping</strong><br /> En väktare kontaktade polisen efter att inbrottslarmet gått hos ett återvinningsföretag i Taberg. På plats kunde man konstatera att ett fönster in till en kontorslokal var krossat och att det var tillrört där inne. Det är i nuläget oklart vad gärningspersonerna fått med sig från platsen. Brottsplatsen har spärrats av för att kunna genomföra en brottsplatsundersökning under dagen. En anmälan om stöld genom inbrott har upprättats.</p>",
