        "description": "Polis larmades till flerfamiljshus.",
        "content": "<p>21:06 Polisen larmades till en lägenhet i området Lagersberg i Eskilstuna. Enligt inringaren ska fönster till lägenheten ha gått sönder. <br /><br /> 21:13 Polis var på plats. <br /><br /> Det finns hål i ett lägenhetsfönster. Polisen arbetar med att ta reda på vad som har hänt. Innegården nedanför lägenheten har spärrats av. Ingen person har skadats.<br /><br />21:55 Polisen misstänker att någon har skjutit in i en lägenhet. Händelsen utreds som framkallande av fara för annan alternativt skadegörelse. Lägenheten har spärrats av för teknisk undersökning. Polisen kommer under kvällen att hålla förhör med vittnen och genomföra dörrknackning på adressen. </p>\n\n<p><strong>Uppdatering kl. 22:50:</strong></p>\n<p>Under ärendets gång har brottsruriceringen ändrats till grovt olaga hot och brott mot vapenlage.</p>\n<p>Den yttre avspärrningen är nu hävd, vissa beslag har gjorts på platsen men dessa kan i nuläget inte kommenteras med anledning av förundersökningssekretess.</p>\n\n\n",
