        "description": "Lägenhetsinbrott i Örbyhus.",
        "content": "<p>På kvällen anmäls ett inbrott i en lägenhet på Blomstervägen i Örbyhus. Den som bor i lägenheten har inte varit hemma under natten och därför är det oklart när inbrottet ägt rum.<br />Gärningsmannen har tagit sig in via balkongen där dörren är uppbruten. När anmälaren såg att det varit inbrott i lägenheten gick anmälaren genast ut igen och bland annat därför är det oklart vad som stulits.<br />Teknisk undersökning kommer att genomföras vid ett senare tillfälle.</p>",
