        "description": "Drograttfylleri, grov olovlig körning m.m. på väster i Örebro.",
        "content": "<p>En polispatrull observerade en personbil som kördes med släckt belysning i hög fart på en gata på väster i Örebro. Bilen kunde snart stoppas på en angränsande gata. Förutom föraren, som är en man i 40-årsåldern, var en man i 20-årsåldern passagerare i bilen. I samband med stoppet såg polispatrullen att de kastade ifrån sig något som visade sig vara misstänkt narkotika.</p>\n<p>Båda männen visade tecken på att vara drogpåverkade varför de medtogs för provtagning och förhör.</p>\n<p>Föraren är nu misstänkt för grov olovlig körning, drograttfylleri samt narkotikabrott. Passageraren är misstänkt för narkotikabrott. Misstankarna gäller både innehav och eget bruk för dem båda.</p>",
