        "description": "Försök till väskryckning i Kumla.",
        "content": "<p>Två män fösökte, vid 18:30 tiden eller strax därefter, slita till sig en väska från en dam i 75-årsåldern utefter Södra Kungsvägen ca 100 m söder om rondellen vid Vårdcentralen.</p>\n<p>Målsägaren uppfattade inte att männen sa något till henne utan slet endast och drog i hennes väska. Hon lyckades dock hålla emot och efter en stund släppte männen väskan och målsägaren kunde gå från platsen.</p>\n<p>Signalementet på männen: Båda är uppskattningsvis i 20-årsåldern, ca 180 cm långa och var mörkt klädda.</p>\n<p>Flera polispatruller med bl.a. hundpatrull var på plats före kl 19 men lyckades inte lokalisera någon som kunde misstänkas för brottet som är rubricerat som försök till rån.</p>\n\n\n",
