        "title_type": "Stöld/inbrott",
        "title_location": "Norrköping",
        "description": "Man greps efter tips om stöld.",
        "content": "<p>11.22 polisen fick samtal från en inringare som sade sig ha bevittnat en stöld på Bryggaregatan. Inringaren lämnade en bra beskrivning på mannen och vilken riktning han gick.</p>\n<p>Polisen åkte till platsen och började spana efter mannen. Ganska snart anträffades en man som stämde bra på det angivna signalementet. Mannen bar också på en kasse med föremål som misstänks vara stulna. Mannen, som är i 35-årsåldern greps och fördes till polisstationen för förhör.</p>\n<p>Vid ytterligare utredning har det framkommit att mannen misstänks ha sparkat sönder ett fönster och därefter tagit sig in i en bostad där han har tillgripit en bärbar dator, två kameror och några klädesplagg som han bar i en plastkasse när han gick från platsen.</p>\n<p>När mannen har förhörts kommer en åklagare att fatta beslut om den fortsatta förundersökningen och om den gripne ska vara fortsatt frihetsberövad.</p>\n",
