        "description": "Dagens presstalesman är Thomas Fuxborg och till kvällen kommer Anna Göransson.",
        "content": "<p><strong>00.56 Skövde, inbrott</strong><br />Vid Nolhagavägen går ett inbrottslarm igång och en väktare som kommer till platsen kan konstatera att en taklucka till COOP-butiken är uppbruten. Inga tjuvar kvar i butiken och det är oklart vad som saknas.</p>\n<p><strong>01.05 Vara, inbrott</strong><br />Vid Torggatan går inbrottslarmet igång i Apoteket. Polis på plats kan konstatera att någon krossat en ruta till butiken och tagit sig in. Oklart vad som saknas. Inga tjuvar kvar på platsen.</p>\n<p><strong>01.25 Mölndal, inbrott</strong><br />Vid Arnegårdsgatan går ett kameralarm igång i Mekonomenbutiken och två personer syns i kameran. De ses stjäla verktyg. Polis och väktare kommer till platsen och två män födda -82 och -86 kan gripas i anslutning till butiken.</p>\n<p><strong>02.01 Borås, inbrott</strong><br />Viod Brämhultsvägen går inbrottslarmet igång i Villastadens Matbutik. Någon har krossa ett fönster in till butiken och tagit sig in. Oklart vad som saknas. I närområdet kan polis gripa två män födda -95 och -98 som kan kopplas till inbrottet.</p>\n\n",
