        "description": "Sammanfattning av nattens polisverksamhet i polisområde Södermanland.",
        "content": "<p>06.10 polisen har hittills hanterat ett 25-tal rutinärenden, huvudsakligen utan brottsmisstankar. Två personer har gripits, en har omhändertagits för berusning/ordningsstörning och tre har fått följa med för provtagning och förhör med anledning av misstänkt drogpåverkan.</p>\n<p>00.18 SOS-larm till polisen om brand utomhus på Brandkärrsvägen i Nyköping. Det visade sig vara två personbilar som brann och polisen har påbörjat en utredning om skadegörelse genom brand eftersom det finns misstanke om att branden är anlagd. Det finns ingen misstänkt. Polisen tar gärna emot tips och iakttagelser angående händelsen. Tipsa polisen på 114 14 eller via polisens tipsformulär.</p>\n<p>00.20 vid en rutinkontroll på E4 vid Påljungshage uppstod misstanke om drograttfylleri och en man i 20-årsåldern fick följa med för provtagning och förhör, misstänkt för drograttfylleri. En passagerare, man i 25-årsåldern fick också följa med för provtagning och förhör misstänkt för ringa narkotikabrott genom eget bruk och innehav samt brott mot knivlagen.</p>\n<p>01.31 vid en rutinkontroll av en cyklist uppstod en misstanke om ringa narkotikabrott och stöld av cykel. En man i 40-årsåldern fick följa med polisen för provtagning och förhör. Cykeln togs i beslag.</p>\n<p>02.32 polisen fick samtal om att ett tidningsbud hade blivit utsatt för stöld av flera paket från sin cykel på Drottninggatan, nära Nygatan i Eskilstuna. Tidningsbudet hade sett en person gå in i ett hus i samband med stölden. Polisen kom till platsen och började utreda vad som hänt och efter en tids spanande på adressen kom en kvinna ut ur huset. Polisen tog kontakt med kvinnan, som är i 25-årsåldern och misstanke uppstod om att hon var drogpåverkad. Hon förhördes och misstanke uppstod om ringa narkotikabrott eget bruk samt stöld från tidningsbudet. Polisen genomförde en husrannsakan i kvinnans bostad och då anträffades paket som polisen misstänker har koppling till stölden. Kvinnan greps då misstänkt för ringa narkotikabrott och stöld. Hon lades in i en arrest för tillnyktring och kommer att förhöras när hon nyktrat till.</p>\n<p><strong>Uppdatering kl 13.15: </strong>Den misstänkta kvinnan har förhörts av polisen under förmiddagen och därefter frigavs hon av åklagare, men hon är fortfarande mistänkt.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>\n\n\n\n\n\n",
        "content_formatted": "<p><p>06.10 polisen har hittills hanterat ett 25-tal rutinärenden, huvudsakligen utan brottsmisstankar. Två personer har gripits, en har omhändertagits för berusning/ordningsstörning och tre har fått följa med för provtagning och förhör med anledning av misstänkt drogpåverkan.</p></p><p><p>00.18 SOS-larm till polisen om brand utomhus på Brandkärrsvägen i Nyköping. Det visade sig vara två personbilar som brann och polisen har påbörjat en utredning om skadegörelse genom brand eftersom det finns misstanke om att branden är anlagd. Det finns ingen misstänkt. Polisen tar gärna emot tips och iakttagelser angående händelsen. Tipsa polisen på 114 14 eller via polisens tipsformulär.</p></p><p><p>00.20 vid en rutinkontroll på E4 vid Påljungshage uppstod misstanke om drograttfylleri och en man i 20-årsåldern fick följa med för provtagning och förhör, misstänkt för drograttfylleri. En passagerare, man i 25-årsåldern fick också följa med för provtagning och förhör misstänkt för ringa narkotikabrott genom eget bruk och innehav samt brott mot knivlagen.</p></p><p><p>01.31 vid en rutinkontroll av en cyklist uppstod en misstanke om ringa narkotikabrott och stöld av cykel. En man i 40-årsåldern fick följa med polisen för provtagning och förhör. Cykeln togs i beslag.</p></p><p><p>02.32 polisen fick samtal om att ett tidningsbud hade blivit utsatt för stöld av flera paket från sin cykel på Drottninggatan, nära Nygatan i Eskilstuna. Tidningsbudet hade sett en person gå in i ett hus i samband med stölden. Polisen kom till platsen och började utreda vad som hänt och efter en tids spanande på adressen kom en kvinna ut ur huset. Polisen tog kontakt med kvinnan, som är i 25-årsåldern och misstanke uppstod om att hon var drogpåverkad. Hon förhördes och misstanke uppstod om ringa narkotikabrott eget bruk samt stöld från tidningsbudet. Polisen genomförde en husrannsakan i kvinnans bostad och då anträffades paket som polisen misstänker har koppling till stölden. Kvinnan greps då misstänkt för ringa narkotikabrott och stöld. Hon lades in i en arrest för tillnyktring och kommer att förhöras när hon nyktrat till.</p></p><p><p><strong>Uppdatering kl 13.15: </strong>Den misstänkta kvinnan har förhörts av polisen under förmiddagen och därefter frigavs hon av åklagare, men hon är fortfarande mistänkt.</p></p><p><p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p></p><p></p>",
