        "description": "Ett urval av händelser i länet sedan klockan 22 i går kväll.",
        "content": "<p>Polisen i Jönköpings län har hanterat ett 30-tal händelser sedan klockan 22 i går kväll. Två personer har gripits, se händelse nedan.</p>\n<p><strong>02.04 Trafikolycka, Jönköping</strong><br /> Polis larmades till Axamo där en personbil hade voltat och kört av vägen. Två personer befann sig i bilen, båda visade sig vara pojkar i 15-årsåldern. De var vakna och talbara efter olyckan men fick följa med ambulans till sjukhus. Föraren visade sig ha tagit bilen utan tillåtelse från sina föräldrar. Han är misstänkt för tillgrepp av fortskaffningsmedel, vårdslöshet i trafik och olovlig körning.</p>\n<p><strong>03.38 Stöld, Vetlanda</strong><br /> En polisbil skulle stoppa en personbil för kontroll utanför Vetlanda. Föraren vägrade stanna och ett förföljande inleddes. Färden gick söderut och pågick i flera mil i varierande hastighet. Då man närmade sig gränsen till polisregion Syd fick man hjälp av en patrull från Syd som ställde upp med spikmatta i en korsning i Bäckaby. Där körde bilen på spikmattan och färden fick ett odramatiskt slut klockan 04.15. Två personer satt i bilen, bägge män i 40-årsåldern. När bilen genomsöktes fann man misstänkt stöldgods samt verktyg som man misstänker har använts vid inbrott. De två männen greps misstänkta för stöld genom inbrott. Föraren är även misstänkt för drograttfylleri, ringa narkotikabrott samt hot mot tjänsteman.</p>",
        "content_formatted": "<p><p>Polisen i Jönköpings län har hanterat ett 30-tal händelser sedan klockan 22 i går kväll. Två personer har gripits, se händelse nedan.</p></p><p><p><strong>02.04 Trafikolycka, Jönköping</strong><br /> Polis larmades till Axamo där en personbil hade voltat och kört av vägen. Två personer befann sig i bilen, båda visade sig vara pojkar i 15-årsåldern. De var vakna och talbara efter olyckan men fick följa med ambulans till sjukhus. Föraren visade sig ha tagit bilen utan tillåtelse från sina föräldrar. Han är misstänkt för tillgrepp av fortskaffningsmedel, vårdslöshet i trafik och olovlig körning.</p></p><p><p><strong>03.38 Stöld, Vetlanda</strong><br /> En polisbil skulle stoppa en personbil för kontroll utanför Vetlanda. Föraren vägrade stanna och ett förföljande inleddes. Färden gick söderut och pågick i flera mil i varierande hastighet. Då man närmade sig gränsen till polisregion Syd fick man hjälp av en patrull från Syd som ställde upp med spikmatta i en korsning i Bäckaby. Där körde bilen på spikmattan och färden fick ett odramatiskt slut klockan 04.15. Två personer satt i bilen, bägge män i 40-årsåldern. När bilen genomsöktes fann man misstänkt stöldgods samt verktyg som man misstänker har använts vid inbrott. De två männen greps misstänkta för stöld genom inbrott. Föraren är även misstänkt för drograttfylleri, ringa narkotikabrott samt hot mot tjänsteman.</p></p>",
