        "description": "Ett urval av nattens händelser i länet",
        "content": "<p><strong>00:19 - Lugn start på natten, inga händelser att rapportera</strong></p>\n<p><strong>03:48 - Stöld, Skönsberg, Sundsvall</strong></p>\n<p>Polis kallas till platsen då en vakt fått larm om att en obehörig man befann sig där. Polis lokaliserar mannen som är i 50-årsåldern och kan gripa honom. Han misstänkts nu för stöld och förs till polisstationen för vidare utredningsåtgärder såsom förhör och åklagarkontakt.</p>\n<p><strong>03:55 - Narkotikabrott, centrala Örnsköldsvik</strong></p>\n<p>Polis träffar på en man som uppvisar tydliga tecken på att vara påverkad av narkotiska preparat. Mannen som är i 30-årsåldern, medtas till provtagning och en anmälan rörande narkotikabrott eget bruk upprättas.</p>\n<p>Sammanfattningsvis en natt med normal arbetsbelastning i länet. Polisen har även utfört ett antal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>",
