        "description": "Försök till mord",
        "content": "<p>SKELLEFTEÅ, FÖRSÖK TILL MORD</p>\n<p>Kl. 22.00 cirka så fick polisen samtal om ett grovt våldsbrott i ett samhälle utanför Skellefteå. När polisen anlände till platsen så anträffades två svårt skadade personer. De är förda i ambulans till Skellefteå Lasarett. Insats pågår.</p>\n<p><strong>Uppdatering 07:11:</strong></p>\n<p>Polisen utreder händelsen som försök till mord. Under dagen kommer ytterligare utredningsåtgärder att genomföras.</p>\n<p>Förundersökningen leds av åklagare.</p>\n<p>I nuläget kan polisen inte ge mer information kring händelsen.</p>\n<p>Uppdaterat av Åsa Mjörndal, RLC-kommunikatör</p>",
