        "description": "Rån (motvärnsfallet) i livsmedelsbutik i Vara.",
        "content": "<p>En man ertappas av personalen med att stoppa på sig varor i en butik vid Stora Torget. När han blir ertappad så tar han upp en kniv och hotar personalen på plats. Han försvinner sedan ut från butiken med varorna. Ingen person har blivit fysiskt skadad.</p>\n<p>Genom sitt agerande blir han då misstänkt för rån/motvärnsfallet.</p>\n<p>Polis tillkallas. Polisen tror sig veta vem mannen men han har ännu inte gripits. Anmälan upprättas och polisen söker efter den misstänkte.  </p>\n<p><strong>Uppdatering:</strong></p>\n<p>Den man som polisen misstänker ha genomfört rånet kan senare gripas av polis.  </p>\n",
