        "description": "Två olyckor på riksväg 23/34, i höjd med Målbäck.",
        "content": "<p>17.46 Polis larmades med anledning av en viltolycka i södergående riktning på riksväg 23/34, vid Brokind, i höjd med Målbäck. Föraren hade kört på en hjort.</p>\n<p>17.54 Larm till polisen om ytterligare en olycka på samma plats, denna gång i norrgående riktning. En personbil hade, enligt larmet, kört in i en annan, stillastående, personbil i norrgående riktning.</p>\n<p>18.14 Polis på plats.</p>\n<p>18.45 Föraren som var förare av det fordon som var inblandad i viltolyckan har förts till sjukhus i ambulans. Föraren är en kvinna i 60-årsåldern. Polisen har inga uppgifter gällande kvinnans skador.</p>\n<p>Föraren av det stillastående fordonet var utanför sitt fordon och ska inte ha skadats fysiskt.</p>\n<p>Båda bilarna behöver bärgas från platsen.</p>\n<p>Polisen kommer att skriva en anmälan om viltolycka samt en anmälan om beteendebrott då föraren som körde in i det stillastående fordonet misstänks för att inte ha hållit tillräckligt avstånd till framförvarande fordon.</p>",
