        "content": "<p>07.15 polisen har hittills detta dygn hanterat ett 25-tal rutinärenden, huvudsakligen utan brottsmistankar. Ingen har gripits eller omhändertagits men en person har fått följa med för provtagning på grund av drogpåverkan.</p>\n<p>04.15 i samband med en kontroll av en person på cykel på Västergatan i Eskilstuna uppstod misstanke om flera brott. En man i 40-årsåldern blev misstänkt för brott mot knivlagen, ringa narkotikabrott eget bruk och stöld av cykel. Kniven och cykeln togs i beslag. Kniven kommer att förverkas och cykeln kommer om möjhligt att återföras till den rätte ägaren.</p>\n<p>05.10 i samband med rutinpatrullering noterade en polispatrull en bilförare som inte stannade vid stopplikten på Skogsängsgatan i Eskilstuna. Polispatrullen utfärdade ett bötesföreläggande på 2500:- till föraren, en man i 20-årsåldern.</p>\n<p>05.32  i samband med rutinpatrullering noterade en polispatrull en bilförare som inte stannade vid stopplikten på Haleniigatan i Eskilstuna. Polispatrullen utfärdade ett bötesföreläggande på 2500:- till föraren, en man i 50-årsåldern.</p>\n<p>05.47 i samband med rutinpatrullering noterade en polispatrull en bilförare som inte stannade vid stopplikten på Skogstorpsvägen i Eskilstuna. Polispatrullen utfärdade ett bötesföreläggande på 2500:- till föraren, en man i 55-årsåldern.</p>\n<p>07.11 samtal till polisen om att en bilist hade krockat med en älg på länsväg 223 vid Ingelsta. Ingen person skadades men bilen fick plåtskador. Älgen sprang vidare och en eftersöksjägare kallades till platsen.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>",
