        "title_location": "Jönköpings län",
        "description": "Sammanfattning av nattens händelser.",
        "content": "<p>Under natten mot tisdagen har polisen hanterat 20 händelser som rör Jönköpings län. Ingen person har gripits för brott och inga allvarliga brott har kommit till polisens kännedom.  Två personer har omhändertagits för fylleri eller provtagning.<br /><br /> 03:23 Polisen kontaktades av en lastbilsförare på Runevägen i Värnamo. Föraren hade parkerats sin lastbil och låg och sov när han vaknade av ljud som kom underifrån lastbilen. När han tittade ut såg han två mörkklädda personer röra sig utanför lastbilen och misstänkte att de stal diesel. Polis beordrades till platsen men ingen person fanns då kvar. Hundförare fick upp ett står och började söka efter gärningspersonerna. Polisen begärde tågstopp mellan Hörle och Värnamo under tiden 04:05-04:20 då polisen befann sig nära järnvägsspåret. Ingen gärningsperson påträffades. Ungefär 200 liter diesel har stulits och en anmälan om stöld är upprättad. <br /><br /> 03:23 Polisen stannade och kontrollerade en bil och dess förare på Kortebovägen i Jönköping. Föraren, en man 30-årsåldern, visade tecken på att vara narkotikapåverkad och fick följa med för provtagning. Han misstänks för rattfylleri under påverkan av droger och för grov olovlig körning. Bilen har tagits i beslag då föraren misstänks för flera olovliga körningar. Vid husrannsakan i bilen hittades knivar och betonger och även en anmälan om grovt brott mot knivlagen upprättades. <br /><br /> 06:09 En anmälara kontaktade polisen från en gård utanför Vetlanda. Man hade upptäckt att det skett ett inbrott i en låst lada under natten och fyra fyrhjulningar saknas. Polis kommer att åka till platsen under morgonen. <br /><br />UPPDATERING 11:10 Polisen har varit på plats och genomfört en brottsplatsundersökning. DNA som misstänks tillhöra gärningspersonen eller personerna har säkrats. Värdet på de stulna fyrhjulningarna uppskattas till 100 000 SEK styck. Det finns i nuläget ingen misstänkt. Polisen vill gärna ha information från personer som kan ha sett någonting som har samband med stölden. Kontakta då polisen via telefon 114 14. </p>\n",
