        "content": "<p>Under natten mot tisdagen har polisen hanterat 22 händelser som rör Östergötlands län. Ingen person har gripits för brott. Tre personer har omhändertagits för fylleri eller provtagning. <br /><br /> 00:55 Polisen larmades till Skäggebyvägen i Finspång efter att flera lastbilar ska ha utsatts för stöld (slangning) av diesel. Fem lastbilar har drabbats. Varje händelse rubriceras som stöld och varje målsägande kommer att få inkomma med varsin polisanmälan. </p>\n<p>01:53 En polispatrull hade för avsikt att kontrollera två mopeder som körde i Vikingstad, Linköping. Förarna stannade inte för kontroll. En moped hittades slängd och polisens hundförare med hund hittade en man som misstänks vara påverkad av narkotika. Mannen medtogs för provtagning och misstänks för rattfylleri under påverkan av narkotika. <br /><br />  04:27 SOS larmade räddningstjänst, ambulans och polis till en villa utanför Motala med anledning av brand. När räddningstjänst och polis kom till platsen var villan övertänd. En person som är skriven på adressen är saknad. Bilen som den boende mannen äger och brukar stod parkerad utanför. Teknisk undersökning kommer att genomföras när brandplatsen har svalnat. Anledningen till branden är än så länge oklar men utreds som allmänfarlig vårdslöshet.<br /><br />UPPDATERING 10:35 På grund av värmen på platsen görs en bedömning att den tekniska undersökningen av brandplatsen kan ske först på torsdag. Brottsplatsen kommer vara avspärrad tills dess. </p>\n",
        "content_formatted": "<p><p>Under natten mot tisdagen har polisen hanterat 22 händelser som rör Östergötlands län. Ingen person har gripits för brott. Tre personer har omhändertagits för fylleri eller provtagning. <br /><br /> 00:55 Polisen larmades till Skäggebyvägen i Finspång efter att flera lastbilar ska ha utsatts för stöld (slangning) av diesel. Fem lastbilar har drabbats. Varje händelse rubriceras som stöld och varje målsägande kommer att få inkomma med varsin polisanmälan. </p></p><p><p>01:53 En polispatrull hade för avsikt att kontrollera två mopeder som körde i Vikingstad, Linköping. Förarna stannade inte för kontroll. En moped hittades slängd och polisens hundförare med hund hittade en man som misstänks vara påverkad av narkotika. Mannen medtogs för provtagning och misstänks för rattfylleri under påverkan av narkotika. <br /><br />  04:27 SOS larmade räddningstjänst, ambulans och polis till en villa utanför Motala med anledning av brand. När räddningstjänst och polis kom till platsen var villan övertänd. En person som är skriven på adressen är saknad. Bilen som den boende mannen äger och brukar stod parkerad utanför. Teknisk undersökning kommer att genomföras när brandplatsen har svalnat. Anledningen till branden är än så länge oklar men utreds som allmänfarlig vårdslöshet.<br /><br />UPPDATERING 10:35 På grund av värmen på platsen görs en bedömning att den tekniska undersökningen av brandplatsen kan ske först på torsdag. Brottsplatsen kommer vara avspärrad tills dess. </p></p><p></p>",
