        "content": "<p><strong>23:14 - Misshandel, Birsta, Sundsvall</strong></p>\n<p>Polis kallas till platsen då en person har blivit misshandlad. Personen, en man i 20-årsåldern, ska ha blivit skallad av en annan man som sedan lämnade platsen.</p>\n<p>Polis skjutsar målsäganden som inte bedömdes ha något ambulansbehov till sjukhus där han får sina skador tillsedda och skriver en anmälan angående misshandel och olaga hot.</p>\n<p><strong>23:31 - Brand, Örnsköldsvik</strong></p>\n<p>Polis kallas till adressen då det ska vara rökfyllt i trapphuset till ett flerfamiljshus. Räddningstjänsten kan snabbt släcka branden få kontroll på läget.</p>\n<p>Inga personskador har hittills rapporterats. Polis skriver en anmälan angående branden.</p>\n<p><strong>04:37 - Lugnt i länet</strong></p>\n<p>Polisen har utfört ett flertal kontroller av personer och fordon som inte har resulterat i någon brottsmisstanke.</p>\n<p><strong>05:27 - Försök till stöld, Bosvedjan, Sundsvall</strong></p>\n<p>Polis kallas till adressen med anledning av att några personer observerats inne på ett företagsområde. Polis kan där notera fotspår men inte hitta några personer kvar på platsen. </p>\n<p>Polis skriver en anmälan om försök till stöld.</p>\n<p>Sammanfattningsvis en natt med normal arbetsbelastning i länet. </p>",
