        "description": "Centralt. Åldringsbrott.",
        "content": "<p>En kvinna i 95-årsåldern får telefonsamtal från någon som säger sig representera en bank och strax därefter får hon besök av en man som säger sig komma i bankens ärende. Kvinnan, som bor på en adress i centrala Trelleborg, lämnar ifrån sig ett bankkort samt kod till mannen. Polis skickas till adressen.</p>\n<p>Det visar sig att gärningsmännen även försökt genomföra ett lån i kvinnans namn, något som misslyckats.</p>\n<p>Polisen har gripit en man i 35-årsåldern, som befann sig i närheten av brottsplatsen. Mannen misstänks ha genomfört brottet i samråd med annan person.</p>\n",
