        "content": "<p>En polispatrull har under kvällen genomfört ett kortare förföljande av en personbil som inte stannande vid länsväg 200/riksväg 26, Otterbäcken.</p>\n<p>Två personer har kunnat gripas då den misstänkta bilen körde av vägen. Föraren klagade på ont i ryggen och passageraren på ont i ett knä, efter det att de kört av vägen. Föraren körs till sjukhus med hjälp av ambulans. Passageraren körs av polis till ett boende i Örebro.  </p>\n<p>Föraren är född -03 och passageraren är född -02.</p>\n<p>Föraren är misstänkt för vårdslöshet i trafik, ej stannat på polismans tecken, olovlig körning, drograttfylleri, narkotikabrott samt brott mot knivlagen. I bilen har även polisen beslagtagit ett antal knivar.</p>\n",
