        "description": "Åldringsbrott/bedrägeri i Brämaregården.",
        "content": "<p>En kvinna, 82 år gammal och boende på Virvelvindsgatan kontaktar polisen efter det att hon haft besök av en okänd man.</p>\n<p>Mannen har ringt på hos offret, uppgivit att han kommer från hemtjänsten och att han heter \"Markus\". Kvinnan säger då åt mannen att hon inte har någon hemtjänst som besöker henne kvällstid. Mannen tränger trots detta sig in och säger att de ska gå in i vardagsrummet. Kvinnan lyckas knuffa tillbaka mannen in i hallen, hon säger att hon ska ringa polis. Kvinnan trycker även på larmet till hemtjänsten.  </p>\n<p>Mannen lämnar då lägenheten via en branddörr i trapphuset. Oklart om han lyckats komma över något. När hemtjänsten kommer till platsen bekräftas att de inte har någon som heter \"Markus\" som arbetar för dem i området.</p>\n<p>Händelsen ska ha inträffat ca 20 minuter före det att polisen larmas till platsen.</p>\n<p>Polis på väg till platsen.  </p>",
