        "description": "Stöld från butik i centrala Avesta.",
        "content": "<p>Personalen i en butik i centrala Avesta uppmärksammade att larmet vid utgången utlöstes i samband med att en man lämnade butiken. De konfronterade mannen som direkt uppträdde otrevligt varför polis tillkallades.</p>\n<p>En patrull befann sig i närheten och var snabbt på plats. De kunde konstatera att mannen stulit varor för närmare 1400Kr. De bedömde dessutom att mannen var drogpåverkad varför han medtogs för provtagning och förhör.</p>\n<p>En tång som mannen använt vid stölden beslagtogs av patrullen.</p>\n<p>Mannen som är i 45-årsåldern är nu misstänkt för stöld av normalgraden samt för ringa narkotikabrott avseende eget bruk.</p>",
        "content_formatted": "<p><p>Personalen i en butik i centrala Avesta uppmärksammade att larmet vid utgången utlöstes i samband med att en man lämnade butiken. De konfronterade mannen som direkt uppträdde otrevligt varför polis tillkallades.</p></p><p><p>En patrull befann sig i närheten och var snabbt på plats. De kunde konstatera att mannen stulit varor för närmare 1400Kr. De bedömde dessutom att mannen var drogpåverkad varför han medtogs för provtagning och förhör.</p></p><p><p>En tång som mannen använt vid stölden beslagtogs av patrullen.</p></p><p><p>Mannen som är i 45-årsåldern är nu misstänkt för stöld av normalgraden samt för ringa narkotikabrott avseende eget bruk.</p></p>",
