        "description": "Trafikolycka på riksväg 27 söder om Bor.",
        "content": "<p>12.45 SOS-larm till polisen om trafikolycka på riksväg 27 söder om Bor i närheten av infarten till Bråten. Enligt larmet ska fyra bilar vara inblandade och en inringare säger att det är en kökrock. Alla ska vara vakna och talbara.</p>\n<p>12.51 räddningstjänsten är på väg och stänger av trafiken i södergående körriktning.</p>\n<p>13.02 polisen är framme på olycksplatsen.</p>\n<p>13.35 vägen är fortfarande avstängd. Personbilar leds om via länsväg 734 och tung trafik kan passera växelvis förbi olycksplatsen. Bärgare är på väg till olyckan.</p>\n<p>En man i 35-årsåldern har blåst positivt i polisens sållningsinstrument och har därför gripits, misstänkt för rattfylleri. Den gripne förs till sjukhus för provtagning.</p>\n<p>13.40 nytt bud om trafikläget: all trafik går nu växelvis förbi olycksplatsen. Ingen omledning.<br /><br />14:46 Bärgning pågår av två bilar. Polispatrull är kvar på platsen och dirigerar trafik. </p>\n\n\n\n",
