        "description": "Gällande de två män som under gårdagens morgon åkte ut på sjön Fegen att fiska.",
        "content": "<p>En av de två männen hittades igår i vattnet, nära Svenljunga. Mannen kördes till sjukhus med ambulans men hans liv gick inte att rädda. Mannen var i 30-årsåldern, anhöriga är underrättade.</p>\n<p>I dag fortsätter sökandet efter den man som fortfarande saknas. Inget brott misstänks.</p>\n<p><strong>Uppdatering kl 10.45:</strong> <br />En förundersökning gällande grov vårdslöshet i sjötrafik är nu inledd, detta gör det möjligt för polis att ta den båt som är hittad i beslag för en teknisk undersökning. Sökandet efter den man som saknas fortsätter, mannen är i 25-årsåldern. På plats hjälps polishelikopter, polisens hundförare, sjöpolis och polispatruller åt. I nuläget är mannen inte hittad.</p>\n<p><strong>Uppdatering kl 14.30:</strong><br />Inget nytt i ärendet. I händelse att polisen i Halland har någon ny information i ärendet så kommer det att först publiceras på denna sida. Sökinsatsen pågår. Ingen övrig information om de inblandade för närvarande.</p>\n<p><strong>Uppdatering kl 17.00:</strong> Ingen ny information från sökinsatsen.</p>",
