        "content": "<p>Polisen utreder ett misstänkt grovt brott i samband med att samtal inkom om en skadad person i en bostad i Huddinge kommun.</p>\n<p>Polis är på plats för att samla in information och med att säkra förundersökningen.</p>\n<p>Med hänsyn till den pågående insatsen och kan inget ytterligare sägas i nuläget.</p>\n<p><strong>Uppdatering klockan 10.23</strong><br />En förundersökning gällande mord är inledd. Detta efter att en person har avlidit på grund av de skador denne tillfogats. Anhöriga är underättade. Skadorna har troligtvis tillfogats av en kniv.</p>\n<p>Den misstänkta brottsplatsen är en bostad som nu är avspärrad. Tekniker arbetar på platsen och flera andra resurser arbetar på olika sätt med att säkra förundersökningen.</p>\n<p>En person är gripen i ärendet och flera personer har tagits med på förhör. De som har tagits med till förhör är inte misstänka för något brott.</p>\n<p><strong>Uppdatering klockan 12.17<br /></strong>Den avlidne personen är en man. Personen som är frihetsberövad är också en man.</p>",
