        "description": "Tre greps efter samtal om knivskärning i Älvsjö.",
        "content": "<p>Flera patruller åkte till en adress i Älvsjö efter samtal om en misstänkt knivskärning. Då polis kom till platsen visade det sig att en person skadats av två personer av någon form av kniv. Ytterligare personer på platsen fick motta slag i någon form i samband med att de gett sig in i bråket.</p>\n<p>Den knivskadade personen fördes med ambulans till sjukhus. Okänt skadeläge. Skador för övriga som fick motta slag är i nuläget okänt.</p>\n<p>En förundersökning gällande mordförsök samt grov misshandel är inledd. Tre personer är på måndagsmorgonen anhållna mistsänkta för inblandning i ärendet.  </p>",
