        "content": "<p>En person ringer från en bensinstation i Almby och uppger att två personer, en man och en kvinna, som verkar vara påverkade av något har kommit i bil till bensinstationen.</p>\n<p>Polisen åker mot platsen och ser aktuellt fordon köra Hjälmarvägen österut. Polisen försöker stoppa fordonet med ljus- och ljudsignaler men bilisten väljer att köra vidare och ett förföljande påbörjas.</p>\n<p>Bilisten kör österut och svänger av mot Ormesta för att därefter åka mot Universitetet. I höjd med rondellen vid universitetet får polisen stopp på fordonet.</p>\n<p>Ingen person blev skadad i samband med händelsen.</p>\n<p>Bilisten, en kvinna i 30-årsåldern, är misstänkt för drograttfylleri och även andra trafikbrott.</p>\n<p>Det finns ingen information om att passageraren, en man, är misstänkt för något brott.</p>",
