        "description": "Sammanfattning av nattens polisverksamhet i polisområde Södermanland.",
        "content": "<p>Polisen har hittills detta dygn hanterat ett 25-tal rutinärenden i polisområde Södermanland, huvudsakligen utan brottsmisstankar.Ingen har gripits, en har omhändertagits för berusning/ordningsstörning och fyra har fått följa med för provtagning på grund av misstänkt drogpåverkan.</p>\n<p>01.36 vid en rutinkontroll av en bilist i stadsdelen Fröslunda i Eskilstuna uppstod misstanke om grov olovlig körning och ringa narkotikabrott genom innehav. Den som misstänks är en man i 20-årsåldern.</p>\n<p>02.15 SOS-larm till polisen om brand utomhus i Strängnäs. Det visade sig vara en mindre byggnad, ett omklädningsrum vid ett bad som brunnit. Polisen har påbörjat en utredning om skadegörelse genom brand.</p>\n<p>02.44 i samband med en rutinkontroll av en bilist på Stenbrovägen i Nyköping uppstod misstankar om ringa narkotikabrott genom eget bruk på två passagerare i bilen. Två män i 25-årsåldern fick följa med för provtagning.</p>\n<p>05.10 ivid en rutinmässig kontroll av en bilist på Västerleden i Eskilstuna uppstod misstanke om grov olovlig körning på föraren, en man i 55-årsåldern. En passagerare, kvinna i 50-årsåldern fick följa med för provtagning på grund av misstanke om ringa narkotikabrott.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>\n\n\n\n\n",
