        "content": "<p><strong>23.08 Göteborg, trafikolycka<br /></strong>En personbil kör mot färdriktningen på Röde Orm från Partille in mot stan. Bilen kolliderar med en buss. Ambulans kör föraren till bilen till sjukhus, oklart skadeläge. I övrigt finns inga skador uppgivna. En anmälan skrivs.</p>\n<p><strong>00.51 Borås, försök till stöld av fortskaffningsmedel</strong><br />Vittne ser fyra personer ta sig in i en parkerad personbil på en parkering på Varbergsvägen. De fyra lämnar bilen utan att få igång den. Polispatrull kan kontrollera fyra personer som befinner sig i anslutning till parkeringen. En teknisk undersökning av bilen som är tjuvkopplad görs. En anmälan skrivs, ingen gripen i nuläget.</p>\n<p><strong>00.59 Mark, stöld genom inbrott</strong><br />Larm kommer in från en livsmedelsaffär på Förläggarevägen. På plats kan ett inbrott konstateras, okänd person har krossat en ruta och tagit sig in i butiken. Bland annat har tobak stulits. Övervakningskamera finns på platsen. En anmälan skrivs, ingen gripen i nuläget.</p>\n<p><strong>03.09 Karlsborg, stöld genom inbrott</strong><br />På Q8 Norra Vägen har en ruta krossats och okänd gärningsman har tagit sig in i lokalen. I nuläget oklart vad som stulits. På plats kan polis bland annat säkra skospår, en anmälan skrivs men ingen är gripen.</p>\n<p><strong>04.19 Göteborg, brand</strong><br />Tre personbilar brinner på en parkering på Tvetgatan, räddningstjänsten till platsen. Två av bilarna är helt utbrända. En anmälan skrivs, ingen gripen i nuläget.</p>",
