        "title_location": "Jönköpings län",
        "description": "Sammanfattning av nattens polisverksamhet i polisområde Jönköping",
        "content": "<p>06.31 polisen har hittills detta dygn hanterat ett 20-tal rutinärenden, huvudsakligen utan brottsmisstankar. Två personer har gripits, ingen är i övrigt frihetsberövad.</p>\n<p>00.15 polisen fick uppgifter om att en kvinna hade utsatts för brott i en mindre ort i Nässjö kommun. Polisen åkte till platsen och träffade på kvinnan, som hade sårskador, som bedömdes som ej livshotande. Hon fördes till sjukhus med ambulans. Polisen höll förhör med kvinnan och fick en gansk otydlig bild av vad som inträffat och vad som förorsakat skadorna. Polisen träffade på en man, som har en relation med den drabbade kvinnan, och han greps misstänkt för försök till mord och fördes till polisstationen där han förhördes. Polisen har utfört en mängd utredningsåtgärder och bland annat tagit föremål i beslag. En bostad är avspärrad i väntan på en kriminalteknisk undersökning som kommer att genomföras under dagen.</p>\n<p>Den gripne mannen anhölls kl. 04.04 av jouråklagare, han är på sannolika skäl misstänkt för försök till mord. Ytterligare frågor om ärendet hänvisas till åklagarmyndigheten.</p>\n<p>03.51 polisen fick samtal om inbrottslarm och konstaterat inbrott på en skola på Attarpsvägen i Bankeryd där någon ska ha slagit sönder en dörr och tagit sig in i lokalerna. Polisen påbörjade en utredning om stöld genom inbrott utan misstänkt person. Det finns inga uppgifter om vad som saknas i lokalerna.</p>\n<p>05.56 polisen fick samtal om bråk och misshandel på Asecsområdet i Jönköping. Polisen åkte till platsen för att ta reda på vad som hänt. En man som kunde misstänkas för misshandel anträffades och han greps av polisen och fördes till polisstationen för förhör. Han misstänks för misshandel genom att han ska ha sparkat en kvinna i 55-årsåldern i samband med ett bråk om betalning. Den gripne är en man i 60-årsåldern. Det finns inga uppgifter om att den drabbade ska ha sökt sjukhusvård.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>\n\n",
        "content_formatted": "<p><p>06.31 polisen har hittills detta dygn hanterat ett 20-tal rutinärenden, huvudsakligen utan brottsmisstankar. Två personer har gripits, ingen är i övrigt frihetsberövad.</p></p><p><p>00.15 polisen fick uppgifter om att en kvinna hade utsatts för brott i en mindre ort i Nässjö kommun. Polisen åkte till platsen och träffade på kvinnan, som hade sårskador, som bedömdes som ej livshotande. Hon fördes till sjukhus med ambulans. Polisen höll förhör med kvinnan och fick en gansk otydlig bild av vad som inträffat och vad som förorsakat skadorna. Polisen träffade på en man, som har en relation med den drabbade kvinnan, och han greps misstänkt för försök till mord och fördes till polisstationen där han förhördes. Polisen har utfört en mängd utredningsåtgärder och bland annat tagit föremål i beslag. En bostad är avspärrad i väntan på en kriminalteknisk undersökning som kommer att genomföras under dagen.</p></p><p><p>Den gripne mannen anhölls kl. 04.04 av jouråklagare, han är på sannolika skäl misstänkt för försök till mord. Ytterligare frågor om ärendet hänvisas till åklagarmyndigheten.</p></p><p><p>03.51 polisen fick samtal om inbrottslarm och konstaterat inbrott på en skola på Attarpsvägen i Bankeryd där någon ska ha slagit sönder en dörr och tagit sig in i lokalerna. Polisen påbörjade en utredning om stöld genom inbrott utan misstänkt person. Det finns inga uppgifter om vad som saknas i lokalerna.</p></p><p><p>05.56 polisen fick samtal om bråk och misshandel på Asecsområdet i Jönköping. Polisen åkte till platsen för att ta reda på vad som hänt. En man som kunde misstänkas för misshandel anträffades och han greps av polisen och fördes till polisstationen för förhör. Han misstänks för misshandel genom att han ska ha sparkat en kvinna i 55-årsåldern i samband med ett bråk om betalning. Den gripne är en man i 60-årsåldern. Det finns inga uppgifter om att den drabbade ska ha sökt sjukhusvård.</p></p><p><p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p></p><p></p>",
        "content_teaser": "06.31 polisen har hittills detta dygn hanterat ett 20-tal rutinärenden, huvudsakligen utan brottsmisstankar. Två personer har gripits, ingen är i övrigt frihets...",
