        "title_location": "Bromölla",
        "description": "Brand i lägenhet, Ågatan.",
        "content": "<p>Larm inkommer om en brand i en lägenhet på första våningen. Det brinner med öppna lågor. Polis, räddningstjänst och ambulans är på väg till platsen.</p>\n<p><strong>Uppdatering:</strong> Rökdykare är inne i den brandhärjade lägenheten. Evakuering av lägenheter i den berörda trappuppgången påbörjas. Det rör sig om ett trevåningshus.</p>\n<p><strong>Uppdatering:</strong> Inga personer har befunnit sig i den brandhärjade lägenheten.</p>\n<p><strong>Uppdatering:</strong> Tre personer förs med ambulans till sjukhus för kontroll.</p>\n<p><strong>Uppdatering:</strong> Lägenheten spärras av och en teknisk undersökning kommer att genomföras under morgondagen. En anmälan om misstänkt mordbrand upprättas.</p>",
