        "content": "<p>En ung kvinna ringer till polisen och uppger att hon har blivit utsatt för en misshandel av en annan ung kvinna i en lägenhet i Högåsen.</p>\n<p>Anledningen till misshandeln är i nuläget oklar men den misstänkta kvinnan har slagit henne, dragit henne i håret och puttat henne ned för en trappa. Den misshandlade kvinnan känner inte den misstänkta kvinnan men hon vet vem det är. </p>\n<p>Det befann sig ytterligare personer i lägenheten när misshandeln skedde.</p>\n<p>Den slagna kvinnan har skador i ansiktet och ont i kroppen men det finns inga uppgifter om att hon skall ha behövt uppsöka sjukvård.</p>\n<p>Polisen har varit på plats och de kommer att skriva en anmälan gällande misshandel där en ung kvinna född -02 är misstänkt.</p>\n",
