        "content": "<p>SOS-alarm meddelar att en bilist har kört av vägen i Dottebol. Initiala uppgifter gör gällande att föraren av bilen skall ha varit berusad och att denne skall ha sprungit från platsen.</p>\n<p>När patrullen kommer till platsen misstänker man att den person som finns kvar vid bilen, som uppger sig vara passagerare, egentligen är föraren av fordonet. Personen är påverkad.</p>\n<p>Ingen person skall ha blivit skadad i samband med olyckan.</p>\n<p>Polisen är kvar på plats för att försöka utreda vad som har hänt.</p>\n<p>UPPDATERING kl. 12.19</p>\n<p>En hundpatrull har varit på plats för att söka efter den person som uppgetts ha varit förare och som skall ha lämnat platsen. Hunden får dock inte upp något spår från bilen.</p>\n<p>Polisen kan inte styrka att det är passageraren som egentligen har kört bilen.</p>\n<p>Det är i nuläget oklart hur ärendet kommer att bli avrapporterat.</p>",
